import Nav from '../../../src/components/navigation'
import './index.css'

class linkButton{
    constructor(routeId, name, img){
        this.routeId = routeId;
        this.name = name;
        this.img = img;
    }
}

let buttonList = [];
buttonList.push(new linkButton('/login', 'Teste', '/navigation-images/user-profile-icon.png'))
buttonList.push(new linkButton('/login', 'Teste1', '/navigation-images/user-profile-icon.png'))
buttonList.push(new linkButton('/login', 'Teste2', '/navigation-images/user-profile-icon.png'))
buttonList.push(new linkButton('/login', 'Teste3', '/navigation-images/user-profile-icon.png'))
console.log(buttonList[0])


const LandingPage = () => {
    let newButton = new linkButton('/login', 'Teste', '/navigation-images/user-profile-icon.png')
    return(
        <>
            <Nav button={newButton}/>
            <main>
                <div>
                    <h1>Nice pizzas!</h1>
                </div>
            </main>
        </>
    )
}

export default LandingPage;
